use super::token;

pub struct StateMachine {
    program: String,
}

impl StateMachine {
    pub fn new(program: String) -> Self {
        StateMachine{
            program,
        }
    }

    
    pub fn parse(&mut self) -> bool {
        let mut token_stream = token::TokenStream::new(self.program.chars());
        let mut syntatic_stack: Vec<usize> = vec![0; 1];
        let mut curr_tok: token::Token;
        //let mut prev_tok: token::Token;
        let mut action: i32;
        let mut reduction_rule: usize;


        curr_tok = token_stream.next().unwrap();
        loop{
            action = constants::ACTIONTABLE[*syntatic_stack.last().unwrap()][usize::from(curr_tok.clone())];

            dbg!("{:?}",action);
            if action > 0 {
                syntatic_stack.push(usize::try_from(action).unwrap());
                //prev_tok = curr_tok;
                curr_tok = token_stream.next().unwrap();
                dbg!("{:?}", curr_tok.clone());
            }
            else if action < 0 {
                /* 
                 * Popping the corresponding states. There is a one-unit padding in the rule
                 * enumeration because we need to start counting the rules from 1 as 0's in the
                 * table means syntax error and the indexing in arrays starts from 0. That's why
                 * reduce_rule = action - 1.
                 */

                action = -action;
                reduction_rule = usize::try_from(action-1).unwrap();
                let new_length = syntatic_stack.len() - constants::RULELEN[reduction_rule];
                syntatic_stack.truncate(new_length);

                // pushing the state after the transition with the non terminal
                syntatic_stack.push(usize::try_from(
                                    constants::ACTIONTABLE
                                    [*syntatic_stack.last().unwrap()]
                                    [constants::RULELEFT[reduction_rule].into_usize()]).unwrap());
            }
            else {
                println!("SYNTAX ERROR\n");
                return false;
            }
            
            if *syntatic_stack.last().unwrap() == 1 {
                println!("FINISHED PARSING\n");
                return true;
            }
        }
    }
}

